import {BrowserRouter as Router, Switch, Route} from "react-router-dom";

// Pages
import {Homepage, Login, Error} from "../../Pages"

function App() {
  return (
    <Router> 
      <Route path="/">
        <Login></Login>
        </Route>    
     <Homepage></Homepage>
    </Router>
  );
}

export default App;
